typedef struct file_t {
    int used;
    FILE* ptr;
    char* name;
    char* buffer;
    unsigned int size; 
} file_t;

file_t files[FILES_COUNT];

void setup() {
    setvbuf(stdin, NULL, _IONBF, 0);
    setvbuf(stdout, NULL, _IONBF, 0);
    setvbuf(stderr, NULL, _IONBF, 0);

    alarm(TIMEOUT);

    memset(files, 0, FILES_COUNT * sizeof(file_t));

    puts(LOGO);
}

void print_menu() {
    puts("Menu:");
    puts("1. Open");
    puts("2. Read");
    puts("3. Close");
    puts("4. Exit"); 
}

unsigned int read_uint() {
    int result;

    scanf("%u", &result);
    getc(stdin);

    return result;
}

char* read_string() {
    char* buffer;

    buffer = (char*)calloc(64 + 1, sizeof(char));
    scanf("%64s", buffer);
    getc(stdin);
    
    return buffer;
}

unsigned int get_file_size(FILE* file) {
    unsigned int size;

    fseek(file, 0, SEEK_END);
    size = ftell(file);
    fseek(file, 0, SEEK_SET);

    return size;
}

void open_file(unsigned int index) {
    if (files[index].used) {
        puts("File is already opened!");
        return;
    }

    puts("Please, input a filename:");
    files[index].name = read_string();
    
    files[index].ptr = fopen(files[index].name, "r");
    if (files[index].ptr == NULL) {
        puts("Failed to open file!");
        return;
    }

    files[index].size = get_file_size(files[index].ptr);
    files[index].buffer = (char*)calloc(files[index].size + 1, sizeof(char));
    files[index].used = 1;

    puts("Successfully opened.");
}

void read_file(unsigned int index) {
    unsigned int size;

    if (!files[index].used) {
        puts("File is not opened!");
        return;
    }

    puts("Please, input a size:");
    size = read_uint();

    if (size > files[index].size) {
        puts("Size is too big!");
        return;
    }

    fseek(files[index].ptr, 0, SEEK_SET);
    fread(files[index].buffer, sizeof(char), size, files[index].ptr);
    fwrite(files[index].buffer, sizeof(char), size, stdout);

    puts("Successfully read.");
}

void close_file(unsigned int index) {
    if (!files[index].used) {
        puts("File is not opened!");
        return;
    }

    fclose(files[index].ptr);
    free(files[index].name);
    free(files[index].buffer);
    memset(&files[index], 0, sizeof(file_t));

    puts("Successfully closed.");
}

int main(int argc, char** argv, char** envp) {
    unsigned int choice;
    unsigned int index;

    setup();

    while (1) {
        print_menu();
        choice = read_uint();

        if (choice == 1 || choice == 2 || choice == 3) {
            puts("Please, input an index:");
            index = read_uint();

            if (index >= FILES_COUNT) {
                puts("Index is too big!");
                continue;
            }
        }

        switch (choice) {
            case 1:
                open_file(index);
                break;
            
            case 2:
                read_file(index);
                break;
            
            case 3:
                close_file(index);
                break;
            
            case 4:
                puts("Bye.");
                return 0;
            
            default:
                puts("Invalid choice!");
                break;
        }
    }

    return 0;
}
